post_content = "<h3>CommBank Drought Support</h3>		
			<h3>Description</h3>		
		<p>If you’re a farmer, a business or member of the community in a drought declared area, there are a range of support measures available for you to access during this difficult time.</p><p>If you’re a farmer or an agribusiness in a drought declared area, some of these services may provide some help and support.</p><ul><li>CommBank support Financial Difficulty:</li></ul><p>If the unexpected happens, and you’re behind in payments, we have guidance and support in place to help. Visit our Financial Difficulty page, or if you’re a business customer with a Relationship Manager you can contact them directly.</p><ul><li>Drought Assistance Package:</li></ul><p>Our Drought Assistance Package is available for regional customers who are affected by drought, and includes other measures such as access to short term, confidential telephone counselling service.</p>		
			<h3>Eligibility</h3>		
		<p>If you have any further questions, or are experiencing financial difficulty, we are here to help. Call <strong>13 30 95</strong> between 8am - 9pm, Monday to Friday and 9am – 2pm Saturday (Sydney time). Write to us at <strong>PO Box 790 Parramatta NSW 2124</strong>.</p>		
			<h3>How to apply</h3>		
		Call 13 30 95 or visit the web page <a style=\"text-decoration-line: underline; transition-duration: 0.3s; transition-timing-function: ease; color: #337ab7; outline: none; font-family: 'Open Sans', GlacialIndifference, sans-serif; font-size: 15px;\" href=\"https://www.commbank.com.au/business/latest/drought-support.html/\">HERE</a>.		
												<figure>
											<a href=\"https://www.commbank.com.au/business/latest/drought-support.html\" target=\"_blank\" rel=\"noopener\">
							<img width=\"400\" height=\"400\" src=\"/wp-content/uploads/2021/08/s5.png\" alt=\"\" loading=\"lazy\" />								</a>
											<figcaption></figcaption>
										</figure>
			<h4>Contact</h4>		
					<ul>
							<li>
											<a href=\"tel:133095\">
										133095
											</a>
									</li>
								<li>
											<a href=\"https://www.commbank.com.au/business/latest/drought-support.html\">
										commbank.com.au/business/latest/drought-support
											</a>
									</li>
								<li>
											<a href=\"mailto:customercare@cba.com.au.\">
										customercare@cba.com.au.
											</a>
									</li>
						</ul>"
